#include <stdio.h>

int main() {
    int veiculos = 0, busao = 0;
    char c = 'O';
    
    while (1) {
        scanf("%c", &c);
        
        if (c != 'O' && 'C' != c)
            break;
        
        ++veiculos;
        if (c == 'O')
            ++busao;
            
        if (0 == (veiculos % 3)) {
            if (c == 'O' && 0 == (busao % 5)) {
                printf("fizzbusao\n");
            } else {
                printf("fizz\n");
            }
        } else {
            if (c == 'O' && 0 == (busao % 5)) {
                printf("%d\n", busao);
            } else {
                printf("%d\n", veiculos);
            }
        }
    }

    return 0;
}
